import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [experience, setExperience] = useState([{ jobTitle: '', company: '', startDate: '', endDate: '', description: '' }]);
  const [education, setEducation] = useState([{ degree: '', field: '', university: '', year: '' }]);
  const [skills, setSkills] = useState('');

  const handleExperienceChange = (index, field, value) => {
    const newExperience = [...experience];
    newExperience[index][field] = value;
    setExperience(newExperience);
  };

  const handleEducationChange = (index, field, value) => {
    const newEducation = [...education];
    newEducation[index][field] = value;
    setEducation(newEducation);
  };

  const handleAddExperience = () => {
    setExperience([...experience, { jobTitle: '', company: '', startDate: '', endDate: '', description: '' }]);
  };

  const handleAddEducation = () => {
    setEducation([...education, { degree: '', field: '', university: '', year: '' }]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const data = {
      name,
      email,
      phone,
      experience,
      education,
      skills: skills.split(','),
    };

    try {
      const response = await axios.post('http://localhost:5000/generate-resume', data, {
        responseType: 'blob', // Important for downloading files
      });

      // Create a link to trigger the download
      const blob = new Blob([response.data], { type: 'application/pdf' });
      const link = document.createElement('a');
      link.href = URL.createObjectURL(blob);
      link.download = 'resume.pdf';
      link.click();
    } catch (error) {
      alert('Error generating resume!');
    }
  };

  return (
    <div className="App">
      <h1>Resume Generator</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Name: </label>
          <input type="text" value={name} onChange={(e) => setName(e.target.value)} required />
        </div>
        <div>
          <label>Email: </label>
          <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
        </div>
        <div>
          <label>Phone: </label>
          <input type="text" value={phone} onChange={(e) => setPhone(e.target.value)} required />
        </div>

        <h3>Experience</h3>
        {experience.map((exp, index) => (
          <div key={index}>
            <input
              type="text"
              placeholder="Job Title"
              value={exp.jobTitle}
              onChange={(e) => handleExperienceChange(index, 'jobTitle', e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="Company"
              value={exp.company}
              onChange={(e) => handleExperienceChange(index, 'company', e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="Start Date"
              value={exp.startDate}
              onChange={(e) => handleExperienceChange(index, 'startDate', e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="End Date"
              value={exp.endDate}
              onChange={(e) => handleExperienceChange(index, 'endDate', e.target.value)}
              required
            />
            <textarea
              placeholder="Description"
              value={exp.description}
              onChange={(e) => handleExperienceChange(index, 'description', e.target.value)}
            />
          </div>
        ))}
        <button type="button" onClick={handleAddExperience}>Add More Experience</button>

        <h3>Education</h3>
        {education.map((edu, index) => (
          <div key={index}>
            <input
              type="text"
              placeholder="Degree"
              value={edu.degree}
              onChange={(e) => handleEducationChange(index, 'degree', e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="Field"
              value={edu.field}
              onChange={(e) => handleEducationChange(index, 'field', e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="University"
              value={edu.university}
              onChange={(e) => handleEducationChange(index, 'university', e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="Year"
              value={edu.year}
              onChange={(e) => handleEducationChange(index, 'year', e.target.value)}
              required
            />
          </div>
        ))}
        <button type="button" onClick={handleAddEducation}>Add More Education</button>

        <div>
          <label>Skills (comma-separated): </label>
          <input
            type="text"
            value={skills}
            onChange={(e) => setSkills(e.target.value)}
            required
          />
        </div>

        <button type="submit">Generate Resume</button>
      </form>
    </div>
  );
}

export default App;
